//Cart page Component

//Module import
import React, { Component } from 'react';

//Style import
import './Cart.css';

class Cart extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }
  render() {
    return (
      <div>
        <p>{this.props.cart}</p>
      </div>
    );
  }
}

export default Cart;
